import React from 'react'; 
import logo from './logo.png'; 

const Logo = () =>{
    return(
        <div style={{width:'100%', height:'20px'}}>
            <img  style={{width:'100px', heigth:'200px'}} src={logo}/>
        </div>
    )
}

export default Logo;
